import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Login from "./components/Login";
import Signup from "./components/Signup";

const App = () => {
  
  return (
    <BrowserRouter>
    <Navbar/>
     <Routes>
      <Route path="/" element={<h1>Home Component</h1>}/>
      <Route path="/shop" element={<h1>Shop Component</h1>}/>
      <Route path="/about" element={<h1>About Component</h1>}/>
      <Route path="/contact" element={<h1>Contact Component</h1>}/>
      <Route path="/login" element={<Login/>}/>
      <Route path="/logout" element={<h1>Contact Component</h1>}/>
      <Route path="/contact" element={<h1>Contact Component</h1>}/>
     </Routes>
    </BrowserRouter>
  );
};

export default App;
